import React from "react";
import CssBaseline from "@material-ui/core/CssBaseline";

import Container from "@material-ui/core/Container";
import { makeStyles } from "@material-ui/core/styles";
//import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import "../../../../index.css";

import "../generalhome/IntroVideo";
import IntroVideo from "../generalhome/IntroVideo";
import ContentImage from "../images/content/ContentImages";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(15),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
  content: {
    fontSize: "52px",
    fontFamily: "Manrope",
  },
  subcontent: {
    fontSize: "20px",
    fontFamily: "Manrope",
    fontWeight: 200,
  },
}));

export default function Headercontent() {
  const classes = useStyles();

  return (
    <React.Fragment>
      <CssBaseline />
      <Container maxWidth="2sm">
        <div className={classes.root}>
          <Grid container spacing={1}>
            <Grid item xs={12}>
              <h2 className={classes.content}>Personal Financial Manager</h2>
            </Grid>
            <Grid
              item
              xs={6}
              style={{ textAlign: "left", padding: "0px 0px 0px 7rem" }}
            >
              <h2 className={classes.content}>Plan your financial goals.</h2>
              <h4 className={classes.subcontent}>
                Manage your investments and liabilities. With My Portfolio Home
                you can plan your short-term and long-term financial goals.
              </h4>
            </Grid>
            <Grid item xs={6} style={{ border: "1px solid red" }}>
              <div style={{ width: "45%" }}></div>
              <IntroVideo></IntroVideo>
              <div style={{ width: "45%" }}>
                <ContentImage image={"graph"}></ContentImage>
              </div>
            </Grid>
            <Grid item xs={3}></Grid>
            <Grid item xs={3}></Grid>
            <Grid item xs={3}>
              <ContentImage image={"3d"}></ContentImage>
            </Grid>
            <Grid item xs={3}>
              <ContentImage image={"paper"}></ContentImage>
            </Grid>
          </Grid>
        </div>
      </Container>
    </React.Fragment>
  );
}
